(8, 'Jen', 'jen@yourappreport.com', 'Hi,\n\nLocName looks like a great app!\n\nIs your app getting as many installs as you''d like it to?\n\nGetting app reviews for LocName on various app review blogs, is a great way to get your app noticed and get you MANY MORE INSTALLS!  We work with over 100 app review websites - these sites review apps and can provide a great deal of traffic to your app. Over the years we have promoted hundreds of apps and networked and created contacts at all of the top app reviews websites.\n\nThe reviews from other sites are great and can send a ton of direct traffic to your app BUT the additional value is in the fact that you are earning direct links to your app page. Links are the currency of the web and these links can increase your apps rankings in both the app store and where it your app appears in Google searches.\n\nToday we have an amazing offer- we''ll submit your app to 155 iPhone App Review Sites on your behalf AND we''ll also provide you with a full spreadsheet listing each website URL and contact details that we used for each one. (So you can reuse our resources for your future apps) AND we will also promote your app with a link on a Facebook profile that has over 4000 app review followers... The BONUS promotion of publishing your app to 4000 app review followers on Facebook is for a limited time.. you get this AND the 155 app review requests all within this package!\n\nLearn more today at the link below. Space is limited and this offer ends tomorrow!\nhttp://www.yourappreport.com/reviews/iphone/7\n\nAnd please let me know if you have any questions about getting app reviews and more installs for LocName.\n\nThanks,\n\nJen\n\nJen (YourAppReport.com)\njen@yourappreport.com\n(608) 492-1872\n', '', 0, '2014-04-09 08:41:35'),
(164, 'Rod Morris', 'morrisrodney594@yahoo.com', 'I was wondering if you have done any search engine/social media work yet this year.  I ask because my wife and I help businesses with S.E.O, social media marketing, website updates/upgrades, making mobile apps or mkaing their site mobile compatible etc.  I do all this from here in the states and I figured since you are as well, it only makes sense to work with someone local.  I do the same things any big company might, I just don''t charge much because I work from home.  If you''d like references just let me know, I have more than I know what to do with. \n\n\nRespectfully,\n\nRM\n(331) 223-9026', '', 0, '2014-06-10 18:43:55'),
(165, 'Morty', 'support@superbsocial.net', 'Hello, my name is Morty Goldman; I just stumbled upon your site - locname.com - I''m sorry to write in such an odd manner, I thought to call you but I didn''t want to take up your time. What I have to say may be of great interest to you. Did you know that an overwhelming majority of businesses, organizations and celebrities buy likes and followers? What, you thought your competitor''s likes and followers are organic and naturally gained? Ha ha. Just recently Gangman Style ( http://www.youtube.com/watch?v=9bZkp7q19f0 ) reached a record 2 billion views. Now imagine the scale of Gangnam Style''s popularity being applied to your business! This is exactly how I deliver results to my clients - and I assure you that you''ll be overwhelmingly pleased with the outcome. \n \nGive us a call: +1 (877) 410-4002 \nor visit us at http://www.SuperbSocial.net', '', 0, '2014-06-27 08:55:19'),
