(1164, 18, 0, '', 'Farsan-Islands', 'dyv4', 'The Farasan Islands are located 40 km off the coast of Jizan in the south-western region of Saudi Arabia. Comprised of a coral-island group, the island was home to the extinct Arabian Gazelle. The island attracts bird watchers as birds migrating from Europe in the winter find warmth in these parts. Snorkeling, diving and boat trips can be taken to and on the island and freshly picked fish is presented for a meal.', '88785, Saudi Arabia', '+966 11 441 8700', 'http://swa.gov.sa', '', '', 0, '0', '0', '16.853354026054863', '41.89707293398442', 'Saudi Arabia', NULL, 0, 0, '', 1396, '2015-02-25 11:09:45', '2015-02-25 11:09:45', 'W', '', 0, 0),
(1165, 18, 0, '', 'Farasan-Islands', 'xg6d', 'The Farasan Islands are located 40 km off the coast of Jizan in the south-western region of Saudi Arabia. Comprised of a coral-island group, the island was home to the extinct Arabian Gazelle. The island attracts bird watchers as birds migrating from Europe in the winter find warmth in these parts. Snorkeling, diving and boat trips can be taken to and on the island and freshly picked fish is presented for a meal.', '1910 Saudi Arabia', '+966 11 441 8700', 'http://swa.gov.sa', '', '', 0, '0', '0', '16.842182077526783', '41.89295306093754', 'Saudi Arabia', NULL, 0, 0, '', 3385, '2015-02-25 11:14:08', '2015-02-25 11:14:08', 'W', '', 0, 0),
(1166, 18, 0, '', 'Safa-Park', 'p7pi', 'Safa Park: Spanning 64 hectares, Safa Park was initially located on the outskirts of Dubai, but is now almost the center of the city. Tens of thousands of trees surround three lakes and house 200 species of birds. Park goers can enjoy time on the grass, panoramic views of the park from the hill, and even a little forest can be found there.', 'Al Hadiqa Street - Dubai - United Arab Emirates', '', '', '', '', 0, '0', '0', '25.1852058', '55.24663799999996', 'United Arab Emirates', 'Dubai', 0, 0, '', 4597, '2015-02-25 11:55:46', '2015-02-25 11:55:46', 'W', '', 0, 0),
(1167, 18, 0, '', 'White-Desert', 'id6r', 'Located 45 km (28 mi) north of the town of Farafra, the White Desert is an area known for its spectacular scenery. The snow-white landscape is strewn with chalk-rock formations and boulders which are sculpted by frequent sandstorms, giving the White Desert a truly alien appearance.', 'Al Wahat Al Bahreya - Al Farafra, Al Farafrah, New Valley Governorate, Egypt', '', '', '', '', 0, '0', '0', '27.330571810862644', '28.18886825561526', 'Egypt', NULL, 0, 0, '', 4599, '2015-02-25 14:02:38', '2015-02-25 14:02:38', 'W', '', 0, 0),
